**Dynamic Array Resizing Example**
=====================================

### Description

This C program demonstrates how to create an array, add elements to it, and then resize the array to accommodate one more element.

### Code

```c 
#include <stdio.h>
#include <stdlib.h>

// Function to print array elements.
void printArray(int arr[], int size) {
    for (int i = 0; i < size; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");
}

int main() {

    // Initial array size and capacity.
    const int initialCapacity = 5;

    // Allocate memory for the initial array.
    int* array = (int*)malloc(initialCapacity * sizeof(int));

    if (!array) {
        printf("Memory allocation failed.\n");
        return -1;
    }

    // Initialize and populate the array with numbers.
    for (int i = 0; i < initialCapacity; i++) {
        array[i] = i * 2; // Simple initialization for demonstration purposes.
    }

I'll provide you with an example Arduino Nano code for a multi-laser setup that incorporates six fancy features.

**Please note:** This is just an example, and you should adjust it according to your specific hardware configuration and requirements.

**Features:**

1. **Fading**: Gradually increase/decrease laser brightness.
2. **Pattern**: Create custom patterns using binary numbers (0s and 1s).
3. **Color-Changing**: Simulate color-changing effects using the laser's intensity.
4. **Random Flash**: Randomly flash the lasers at different intervals.
5. **Beat Mode**: Synchronize laser flashes with music beats ( requires an additional sensor or library).
6. **Manual Control**: Allow manual control of each laser via serial input.

**Code:**
```c++
// Multi-Laser Arduino Nano Code with 6 Fancy Features

const int numLasers = 6; // Number of lasers connected to digital pins 2-7

int laserPins[] = {2, 3, 4, 5, 6, 7}; // Digital pin connections for each laser

// Pattern storage ( binary representation, 0 = off, 1 = on)
byte pattern[numLasers] = {
  B110101, // Initial pattern, modify as needed ( binary number up to 8 bits)
};

void setup() {
  Serial.begin(9600); // Initialize serial communication

  // Set all laser pins as output and initialize them to low state (off)
  for (int i = 0; i < numLasers; i++) {
    pinMode(laserPins[i], OUTPUT);
    digitalWrite(laserPins[i], LOW);
  }
}

void loop() {
  // Feature #1: Fading - Gradually increase and decrease laser brightness (every 10 seconds)
  static long lastFade = millis();
  if (millis() - lastFade > 10000) {
    fadeLasers(); // Call the fading function every 10 seconds (adjust interval as needed)
    lastFade = millis();
  }

  // Feature #2: Pattern - Display custom pattern using binary numbers ( repeat indefinitely)
  displayPattern(pattern);

  // Feature #3: Color-Changing - Simulate color change effect using laser intensity ( random timing)
  simulateColorChange();

  // Feature #4: Random Flash - Randomly flash lasers at varying intervals (1-5 seconds)
  flashLaserRandomly();

  // Feature #5: Beat Mode - Flash lasers in sync with music beats ( commented out by default, see below)
  // readMusicBeats(); // Requires a sound level sensor or beat-detecting library

  // Feature #6: Manual Control - Read serial input to control individual lasers manually (e.g., 'a' turns laser 1 on, 'z' turns it off)
  if (Serial.available()) {
    char c = Serial.read();
    manualControl(c); // Pass serial input character to the manual control function;
  }
}

// Feature functions implementation...
void fadeLasers() {
  byte fadeValue = map(random(255), 0, 254, 50, 255); // Generate random value between 50-255 (range can be adjusted)

  for (int i = 0; i < numLasers; i++) {
    analogWrite(laserPins[i], fadeValue); // Write the random fade value to each laser pin using PWM (if supported)
    delay(200); // Pause briefly between adjustments ( adjust duration as needed)
  }
}

void displayPattern(byte* p) {
  for (int i = 0; i < numLasers; i++) {
    bitWrite(digitalWrite(laserPins[i]), i, bitRead(*p, i)); // Turn each laser on/off based on corresponding binary digits in the pattern array 
  }
}

void simulateColorChange() {
  static unsigned long changeTime = millis();
  if (millis() - changeTime > random(500, 3000)) {
    for (int i = 0; i < numLasers; i++) {
      analogWrite(laserPins[i], random(255)); // Rapidly change laser intensities to create color change illusion (fine-tune random range as desired)
      delay(10); // Brief pause between changes (optional, fine-tuning only)
    }
    changeTime = millis();
  }
}

